// GaleriaCard.js
import React from 'react';

function GaleriaCard({ galeria }) {
    return (
        <div className="galeria-card">
            {/* Aquí puedes mostrar la información relevante de tu galería */}
            <p>{galeria.descripcion}</p>
            <img src={`/imagenesdegaleria/${galeria.imagen}`} alt={galeria.descripcion} />
            {/* ... cualquier otra información que quieras mostrar */}
        </div>
    );
}

export default GaleriaCard;
